import React, { useState, useEffect } from 'react';
import Routes from './routes';
import FilterBar from './layouts/Sidebar'
import '../src/assets/style.css'
import Sidebar from './layouts/Sidebar';

const App = () => {
  const[query, setQuery] = useState("");

  const getQuery = (word) => {
    setQuery(word);
    // console.log(query);
  }

  return (
    <div>
      <div id="outer-container">
        <Sidebar request = {getQuery} pageWrapId={"page-wrap"} outerContainerId={"App"} />
        <div id="page-wrap">
          <Routes query = {query}/>
        </div>
      </div>
    </div>
  );
}

export default App;
